import React from 'react';
import Navigation from '../navigation/Navigation';
const Ajout = () => {
    return (
        <div>
            <h3>Page Ajout</h3>
            <Navigation />

            <form action="">
                <input type="text" placeholder='ajouter client' />
                <br />
                <input type="text" placeholder='ajouter client' />
            </form>
        </div>
    );
};

export default Ajout;
